import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import List from './List';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<List />} />
            </Routes>
        </Router>
    );
};


export default App;
